import logo from "./logo.svg";
import "./App.css";
import { Component } from "react";
import Login from "./Pages/Login";
import { BrowserRouter as Route } from "react-router-dom";

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <Route path="/">
          <Login />
        </Route>
        <Route>
          <Admin />
        </Route>
        <Route>
          <User />
        </Route>
      </div>
    );
  }
}

export default App;
